import { containerContext } from '../Container'



function ButtonFeladatok() {


  const visibility = useContext(containerContext)

  const handleClick = (e) => {
    console.log('buttonfeladatok click', e)
  }


    return (
      <div id = 'buttonFeladatok'>
      <div className="flip-box">
        <div className="flip-box-inner">
          <div className="flip-box-front">
            <img src = {buttonFeladatok} alt = 'feladatok' ></img>
          </div>
        <div className="flip-box-back">
          <img src = {buttonFeladatok} alt = 'feladatok' onClick={handleClick(true)} ></img>
        </div>
      </div>
    </div>
    </div>

    );
  }


export default ButtonFeladatok;
